import React, { useState, useEffect, Fragment } from "react";
import { queryString } from "query-string";
import _ from "lodash";
import { Layout, Descriptions, Form, Input, Typography, Divider } from "antd";
import { getUser } from "../../../../services/userServices";
const PersonalCabinet = ({ location }) => {
  const [userdata, setuser] = useState([]);
  console.log(location.state.name);

  useEffect(() => {
    getUser()
      .then(res => res.data)
      .then(data => {
        let user = _.filter(data, function(o) {
          return o.lastname !== location.state.name;
        });
        console.log(user);
      });
  }, []);

  return (
    <Fragment>
      <Layout>
        <Layout.Content style={{ margin: "5em 16px" }}>
          <div
            style={{
              background: "#fff",
              padding: 44,
              minHeight: 380
            }}
            className="border secondary"
          >
            <Descriptions title="User Info">
              <Descriptions.Item label="UserName">
                Zhou Maomao
              </Descriptions.Item>
              <Descriptions.Item label="Telephone">
                1810000000
              </Descriptions.Item>
              <Descriptions.Item label="Live">
                Hangzhou, Zhejiang
              </Descriptions.Item>
              <Descriptions.Item label="Remark">empty</Descriptions.Item>
              <Descriptions.Item label="Address">
                No. 18, Wantang Road, Xihu District, Hangzhou, Zhejiang, China
              </Descriptions.Item>
            </Descriptions>
          </div>
        </Layout.Content>
      </Layout>
    </Fragment>
  );
};

export default PersonalCabinet;
